import React, {
    Component
} from 'react'
import './Location.less';
import ImgUrl from './pic.jpg';

export default class componentName extends Component {

    render() {
        return ( <
            section className = "location" > {
                /*   员工信息组件  */ } <
            div className = "wrap" >
            <
            span style = {
                {
                    fontSize: 20
                }
            } > 项目地址 < /span> <
            p >
            <
            img src = {
                ImgUrl
            }
            style = {
                {
                    height: 90,
                    width: 90
                }
            }
            />  <
            /p> <
            span >
            本项目会把平时工作、 学习中 遇到的事例抽象成 demo 给展现出来。 欢迎 Star <
            /span> <
            /div> <
            /section>
        )
    }
}
